import React, { Component } from 'react'
import Link from 'next/link';

export default class about extends Component {
  render() {
    return (
      <div>
        <Link href="/">
            <a>Home</a>
        </Link>
        <h1>About</h1>
        <p>This is page Tell About </p>
      </div>
    )
  }
}
